import React from 'react'
import "./PageList.css" 


const PageList = () => {

    const menuItems = [
        {
          name: 'Informacije',
          path: '/informacije', 
        },
        {
          name: 'Kursevi',
          path: '/kursevi', 
        }
      ];



  return (
    <div className='PageList__container'> 
        { menuItems.map((item, index) => (
            <a href={item.path} className='PageList__element'>{item.name}</a>
        ))}

    </div>
  )
}

export default PageList
